import React from "react";
import 'bootstrap/dist/css/bootstrap.css';
// import "./NavBar.css";
import {useEffect, useState} from 'react';
import { NavLink } from "react-router-dom";
import { Collapse,
  Navbar,
  NavbarToggler,
  NavbarBrand,
  Nav,
  NavItem,
  UncontrolledDropdown,
  DropdownToggle,
  DropdownMenu,
  DropdownItem,
  NavbarText, Button  } from "reactstrap";

function NavBar({data, currentUser}) {
    const [isOpen, setIsOpen] = useState(false);

    const toggle = () => setIsOpen(!isOpen);
    const [isLoggedIn, setIsLoggedIn] = useState(false);

    const toggle2 = () => setIsLoggedIn(!isLoggedIn);

    return (
      <div>
      <Navbar horizontal="end" color="secondary" >
        <NavbarBrand href="/" >Jobly</NavbarBrand>
        <NavbarToggler onClick={toggle} />
        <Collapse isOpen={isOpen}  navbar >
          <Nav className="me-auto" navbar >
            <NavLink exact to="/login" onClick={toggle2}>Login</NavLink>
            <NavLink exact to="/signup"> Sign Up </NavLink>
            <NavLink exact to="/logout" onClick={toggle2}> Log Out </NavLink>


          </Nav>
        </Collapse>
        <p></p>
      </Navbar>
    </div>

    );
  }


export default NavBar;

